import { useSelector } from "react-redux";
import Cards from "../cards/Cards";

const Favorites = ({myFavorites}) => {
  const favorites = useSelector((state) => state.myFavorites);
  return (

    <div>
     <Cards characters={favorites}/>
    </div>
  );
};

export default Favorites;
